import React from 'react';
import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-success">
      <div className="container">
        <Link className="navbar-brand text-white" to="/">GreenGoods</Link>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
          aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item"><Link className="nav-link text-white" to="/">Hero</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/login">Login</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/profile">Profile</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/orders">Orders</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/cart">Cart</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/search">Search</Link></li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
